                    break;
            }
        
        $time_end = $this->mfunciones_generales->microtime_float();
        $time = $time_end - $time_start;
        
        $data["resultado_soa_fie"] = $resultado_soa_fie;
        $data["time"] = $time;
        
        $this->load->view('configuracion/view_test_ws', $data);
    }
    
    public function CSV_LogsSMS() {
        $this->lang->load('general', 'castellano');
        $this->load->model('mfunciones_generales');
        $this->load->model('mfunciones_microcreditos');
 
        $arrResultado = $this->mfunciones_microcreditos->ListadoLogsSMS_failed();
        $this->mfunciones_generales->Verificar_ConvertirArray_Hacia_Matriz($arrResultado);
        
        header("Content-type: application/csv");
        header("Content-Disposition: attachment; filename=\"initium_logs_sms_failed_" . date('YmdHis') .".csv\"");
        header("Pragma: no-cache");
        header("Expires: 0");
        
        # Generate CSV data from array
        $fh = fopen('php://temp', 'rw'); # don't create a file, attempt
        
        if (isset($arrResultado[0]))
        {
            # write out the headers
            fputcsv($fh, array_keys(current($arrResultado)));

            # write out the data
            foreach ( $arrResultado as $row ) {
                fputcsv($fh, $row);
            }
            rewind($fh);
            $csv = stream_get_contents($fh);
        }
        else
        {
            $csv = '';
        }
        
        fclose($fh);

        print ($csv);
	exit;
    }
